import React from 'react';
import SecondaryHeader from './SecondaryHeader';

const Projects = () => {
    return (
        <div className="ui inverted segment">
            <div className="ui grid">
                <SecondaryHeader />
                <div className="ten wide column">
                    <h1>Projects</h1>
                    <h2>2021</h2>
                    <h4>*Project Name*</h4>
                    <div className="ui divider"></div>
                    <i>Program completed on April 5, 2021.</i>
                    <br />
                    <p>C program to save and edit vehicle information stored inside a hash file using commands.</p>
                </div>
            </div>
        </div>
    );
};

export default Projects;
